query GetAuctions($offset: Int!) {
  allAuctions(orderBy: BID_START_BLOCK_DESC, first: 10, offset: $offset) {
    nodes {
      address
      name
      bidStartBlock
      mintStartBlock
      chainId
      maxUnits
      price
      bidsByAuctionAddressAndAuctionName {
        totalCount
        __typename
      }
      __typename
    }
    totalCount
    __typename
  }
}

