query GetAuction($address: String!, $name: String!) {
  auctionByAddressAndName(address: $address, name: $name) {
    address
    name
    price
    bidStartBlock
    mintStartBlock
    maxUnits
    chainId
    bidsByAuctionAddressAndAuctionName(first: 100, orderBy: SUBMITTED_TIMESTAMP_DESC) {
      nodes {
        bidId
        signer
        status
        submittedTimestamp
        tipRevealed
        amount
        __typename
      }
      totalCount
      __typename
    }
    bundlesByAuctionAddressAndAuctionName {
      nodes {
        bundleHash
        signerAddress
        __typename
      }
      totalCount
      __typename
    }
    __typename
  }
}
